  false,\n\t\"url\": null,\n\t\"notes\": \"Early detection and rapid response to these
  weeds is critical to protection and conservation of the shrubsteppe habitat of the
  National Monument. A calendar of treatments throughout the year has been developed,
  and the remaining work will be implementing treatments on the ground and to continue
  mapping in areas that have not yet been mapped. Treatments will be coordinated and
  conducted April-June and September-December (depending on weather conditions) in
  2005 and 2006. Continued mapping efforts will be conducted simultaneously with treatment.
  Volunteers and partners will participate in conducting this on-the-ground implementation
  of the weed management plan by assisting with treatment of the top priority weeds
  and by surveying and mapping in new areas.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
